NavigationWindow::NavigationWindow(QWidget *parent) : QDialog(parent) {
    QVBoxLayout *layout = new QVBoxLayout(this);

    startPointEdit = new QLineEdit(this);
    startPointEdit->setPlaceholderText("输入起始点");
    layout->addWidget(startPointEdit);

    endPointEdit = new QLineEdit(this);
    endPointEdit->setPlaceholderText("输入终点");
    layout->addWidget(endPointEdit);

    submitButton = new QPushButton("提交", this);
    layout->addWidget(submitButton);

    connect(submitButton, &QPushButton::clicked, this, [this]() {
        QString startPoint = startPointEdit->text();
        QString endPoint = endPointEdit->text();

        std::vector<int> path;
        processPath(startPoint.toStdString(), endPoint.toStdString(), path);

        emit pathGenerated(path);  // 发射路径生成信号
        accept();
    });

    setLayout(layout);
    setWindowTitle("导航");
}

